import './REAviewRandR.css';

const Testrr = ({ rating }) => {
    return (
      <div className="randrdisplay">
        <p className="randrdisplayName">By: Username1</p>
        <p className="randrdisplayRating">Rating: 3.9 / 5</p>
        <p className="randrdisplayReview">Review: Very ethical, ben so cute and so hamsum, i wish i had more FAs like him</p>
        <hr/>
      </div>
    );
  };

  export default Testrr;
